
dict_ = {}

def lcs(s1, s2):
    #print(s1, s2)
    if not (s1 and s2):
        return ""

    if s1 == s2:
        return s1

    if len(s1) > len(s2):
        s1, s2 = s2, s1

    if (s1, s2) not in dict_:
        if s1[0] == s2[0]:
            first = s1[0]
            dict_[(s1, s2)] = first + lcs(s1[1:], s2[1:])
        else:
            v1 = lcs(s1, s2[1:])
            v2 = lcs(s1[1:], s2)
            if len(v1) > len(v2):
                dict_[(s1, s2)] = v1
            else:
                dict_[(s1, s2)] = v2
    #print(len(dict_.keys()))
    return dict_[(s1, s2)]

